import React from "react";

export default function Home() {
    return (
        <div className="flex justify-center">
            <div className="grid grid-cols-5 gap-15">
                <div className="w-100 h-100 bg-red-500">phong</div>
                <div className="w-100 h-100 bg-blue-500">phong</div>
                <div className="w-100 h-100 bg-green-500">phong</div>
                <div className="w-100 h-100 bg-yellow-500">phong</div>
                <div className="w-100 h-100 bg-purple-500">phong</div>
            </div>
        </div>
    );
}
